import React from 'react'
import classes from './navbar.css'
import NavigationItem from '../navigationItem/navigationItem'

let navStyle = {
    backgroundColor: '#333'
}

const navbar = () => {
    return(
        <div
        style = {navStyle}>
            <h1>Secure Vision Dashboard</h1>
            <NavigationItem link="/dashboard/a">Home</NavigationItem>
            <NavigationItem link="/dashboard/b">Activity</NavigationItem>
            <NavigationItem link="/dashboard/c">Unrecognized Vehicles</NavigationItem>
            <NavigationItem link="/dashboard/d">Register new vehicle</NavigationItem>
        </div>
    )
}

export default navbar
